using Booking.Application.Interfaces;

namespace Booking.Persistence.Seeding;

public static class ClearDataSeeder {
	public static void Seed(IBookingDbContext context, IImageService imageService) {
		CancellationTokenSource tokenSource = new CancellationTokenSource();

		if (!context.Countries.Any()) {
			SeedCountries(context, imageService, tokenSource.Token);
		}
	}

	private static void SeedCountries(IBookingDbContext context, IImageService imageService, CancellationToken cancellationToken) {
		context.Countries.AddRange([
			new() {
				Name = "Україна",
				Image = imageService.SaveImageAsync("data:image/jpeg;base64,").Result
			},
			new() {
				Name = "Польща",
				Image = imageService.SaveImageAsync("data:image/webp;base64,").Result
			}
		]);

		context.SaveChangesAsync(cancellationToken);
	}
}
